import React, { Component } from 'react';
import { Column, Columns, Container, Footer, Content, Icon } from 'bloomer';
class MyFooter extends Component {
    constructor(props) {
        super(props);
        this.state = {
            xmlFile: ""
        }
        this.handler = this.handler.bind(this);
    }
    handler(state) {
        this.setState(state);
    }

    render() {
        return (
            <Footer id='footer'>
                <Container>
                    <Content>
                        <Columns>
                            <Column>
                                <p>
                                    Made with<Icon hasTextColor="danger" className="fa fa-heart"></Icon> 
                                    by <a>Algus Dark</a>
                                </p>
                            </Column>
                        </Columns>
                        <Content isSize='small'>
                            <p>The source code is licensed under <a target="_blank">MIT</a>.</p>
                            <p>The website content is licensed under <a target="_blank">CC ANS 4.0</a>.</p>
                        </Content>
                    </Content>
                </Container>
            </Footer>
        );
    }
}

export default MyFooter;
